import './CMS.css';
import NewsPanel from '../components/CMS/NewsPanel';
import img from '../../images/header-backgrounds/fans.jpg'

export default function CMS(){
    return(
        <div className="cms-wrapper">
                <NewsPanel 
                    title="dzien dobry"
                    text="gdzie pan idzie"
                    src={img}
                    />
        </div>
    )
}
